BOOK INFO:

Search engines, with Google at the top, have become the most heavily used online service, with millions of searches performed every day and many remarkable capabilities. Soft Computing for Information Processing and Analysis includes reports from the front of soft computing in the internet industry and imparts knowledge and understanding of the significance of the field's accomplishments, new developments and future directions. This carefully edited book has evolved from presentations made by the participants of a meeting entitled &quot;Fuzzy Logic and the Internet: Enhancing the Power of the Internet&quot;, organized by the Berkeley Initiative in Soft Computing (BISC), University of California, Berkeley. It addresses the important topics of modern search engines such as fuzzy query, decision analysis and support systems, including articles about topics such as Web Intelligence, World Knowledge and Fuzzy Logic (by Lotfi A. Zadeh), perception based information processing, or web intelligence.
